import React from 'react';

function Note(props){

    function handleDelete(){
        props.onDelete(props.id);
    }
    return <div className='note'>
    <h1>{props.title}</h1>
    <p>{props.content}</p>
    <button onClick={handleDelete}><a target="_blank" href="https://icons8.com/icon/99950/delete">Delete</a> icon by <a target="_blank" href="https://icons8.com">Icons8</a></button>
    </div>
}
export default Note;
